import React from "react";

export default function WeatherForecast() {
  return (
    <div className="WeatherForecast">
      <div className="row">
        <div className="col">
          <div>Monday</div>
          <div>Icon</div>
          <div>Date</div>
        </div>
      </div>
    </div>
  );
}
